// T=20=Account
// K=07=Check
// C=14=Credit Card
// D=13=Direct Debit
// A=19=Direct Deposit
// X=01=Cash
result = "01";
// Evaluate
String tenderType = (String) _Document.get_Value("TenderType");
if(tenderType == null || tenderType.equals("X")) {
  result = "01";
} else if(tenderType.equals("T")) {
  result = "20";
} else if(tenderType.equals("K")) {
  result = "07";
} else if(tenderType.equals("C")) {
  result = "14";
} else if(tenderType.equals("D")) {
  result = "13";
} else if(tenderType.equals("A")) {
  result = "19";
}

import java.lang.String;
BigDecimal payAmt = (BigDecimal) _Document.get_Value("PayAmt");
String value = String.format("%.2f", new Object[]{payAmt}).replace(".", "").replace(",", "");
value = String.format("%1$" + _FiscalDocumentLine.getMaxLength() + "s", new Object[]{value}).replace(" ", "0");
result = value;

import java.text.SimpleDateFormat;
SimpleDateFormat format = new SimpleDateFormat("dd/MM/yyyy");
Timestamp date = (Timestamp) _Document.get_Value("ReversalDocumentDate");
// Set result
result = format.format(date);

// =E
//"=8
//!=12
//#=22
result = " ";
MTax tax = MTax.get(_Ctx, _Document.get_ValueAsInt("C_Tax_ID"));
if(tax != null 
    && tax.getRate() != null) {
    double taxRate = tax.getRate().setScale(2, BigDecimal.ROUND_HALF_UP).doubleValue();
    if(taxRate == 0)
        result = " ";
    else if(taxRate == 8)
        result = "\"";
    else if(taxRate == 12)
        result = "!";
    else if(taxRate == 22)
        result = "#";
}

